package net.bodz.dist.pcl;

public class ActivateException extends Exception {

    private static final long serialVersionUID = 6411325323493045096L;

    public ActivateException() {
        super();
    }

    public ActivateException(String message, Throwable cause) {
        super(message, cause);
    }

    public ActivateException(String message) {
        super(message);
    }

    public ActivateException(Throwable cause) {
        super(cause);
    }

}
